import React from "react";
import "./ContentCardStyle.css";

function ContentCard() {
  return (
    <div>
      <div className="contentCardStyle">
        <img
          src="https://cdn.pixabay.com/photo/2014/05/22/16/52/pyrenees-351266_960_720.jpg"
        />
        <h3>Pyreenees mountain range</h3>
        <p> Spain and France</p>
        <a href="https//www.google.com"> google </a>
      </div>
      <div >
        <img
          src="https://cdn.pixabay.com/photo/2016/10/22/17/46/scotland-1761292_960_720.jpg"
        />
        <h3>Scotland mountain ranges</h3>
        <p> Scotland</p>
        <a href="https//www.google.com"> google </a>
      </div>
    </div>
  );
}

export default ContentCard;
